import React, { useState } from "react";
import "../../App.css";
import TextField from "@material-ui/core/TextField";
import TextareaAutosize from "@material-ui/core/TextareaAutosize";
import Checkbox from "@material-ui/core/Checkbox";
import CheckBoxOutlineBlankIcon from "@material-ui/icons/CheckBoxOutlineBlank";
import CheckBoxIcon from "@material-ui/icons/CheckBox";
import FormControlLabel from "@material-ui/core/FormControlLabel";

export default function Appointment() {
  return (
    <form className="appointment">
      <div className="form--container">
        <p className="title">Osobni podaci</p>
        <TextField label="Ime" placeholder="Ivan" required />
        <TextField label="Prezime" placeholder="Horvat" required />
        <TextField
          label="Adresa e-pošte"
          placeholder="ivan.horvat@mail.com"
          required
        />
        <TextField label="Telefon/mobitel" placeholder="0912345678" required />
      </div>

      <div className="form--container">
        <p className="title">Podaci vezani za narudžbu</p>
        <TextField label="Šifra proizvoda" placeholder="1234567" required />
        <TextField label="Količina" placeholder="4" required />
        <TextField label="Dimenzija" placeholder="195/50/15" required />
        <TextareaAutosize
          aria-label="Dodatni komentar"
          rowsMin={5}
          placeholder="Komentar..."
        />
      </div>

      <div className="form--container">
        <FormControlLabel
          control={
            <Checkbox
              //   checked={state.checkedG}
              //   onChange={handleChange}
              name="checkedG"
            />
          }
          label="Custom color"
        />
        <input></input>
      </div>
    </form>
  );
}
